import React, { Component } from 'react'
import axios from 'axios'
import { B} from 'react-router-dom'

import Post from "./Post"
import Contact from "./Contact"

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            name: "",
            email: "",
            picture: "",
            imges: []
        }
    }
    componentDidMount =() => {
        this.setState({name: localStorage.getItem('name')})
        this.setState({email: localStorage.getItem('email')})
        this.setState({picture: localStorage.getItem('picture')})

        axios.get('https://dog.ceo/api/breeds/image/random/7')

            .then(res => {
                this.setState ({
                    imges: res.data.message
                })
            })      
    }
    render() {
        return (
            <div>
                <nav>
                    <Link to="/">Home</Link>
                    <Link to="/contact">Contact</Link>

                </nav>
                <div>
                    <h4>{this.state.name}</h4>
                    <h4>{this.state.email}</h4>
                </div>
                {this.state.imges.map((item, index) => (
                    <Post key={index} title="This is my dog" img={item}></Post>
                ))}
            </div>
        )
    }
}
